  \"2013-03-14T19:28:11.008787\",\n\t\"name\": \"delta-vegetation-and-land-use-ds292\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Vegetation and land use are mapped for
  the approximately 725,000 acres constituting the Legal Delta portion of the Sacramento
  and San Joaquin River Delta area. Vegetation mapping is to sub-alliance to super-alliance
  level (based on the National Vegetation Classification Standard, see http://biology.usgs.gov/npsveg/nvcs.html
  ); land use is mapped to Anderson Level 2 classification ( see http://landcover.usgs.gov/pdf/anderson.pdf
  ). The map classification is based on a vegetation classification derived from field
  data collected in summer and fall of 2005 produced by the Vegetation Classification
  and Mapping Program of the Department of Fish and Game. The 2002 Stockton, Sacramento,
  and Delta High Resolution (1-foot) Orthoimagery and 2005 NAIP (1-meter) orthoimagery
  served as the base. Natural vegetation comprises approximately 17% of the Delta
  study area, 65% is agriculture and pasture, 10% is urban/other and 8% is open water.\",\n\t\"license_title\":
